import '../App.css';

function Art(props) {

    if(props.data != null)
        console.log("Art ", props.data.length);

    let artistName = "";
    let artURL = "";
    let artTitle = "";

    if(props.data != null) {
        artistName = props.data.artistDisplayName;
        artURL = props.data.primaryImage;
        artTitle = props.data.title;
        console.log("Art ", artURL, artistName, artTitle);
    }

    return (
        <div className="App">
            <div className="App-content">
                <img src={ artURL } className="App-logo" alt="Museum Art Image" />
                <p>{ artTitle }</p>
                <p>{ artistName } </p>
            </div>
            <footer className="App-footer">
                <p> Akash Selvakumar | akashs1@umbc.edu | Entera Assessment July 12, 2022</p>
            </footer>
        </div>
    );
}

export default Art;
